sys_variable_value.value:
(function execute(inputs, outputs) {
// ... code ...
  var v_response=inputs.response;
  var v_status= inputs.status;
  if(v_status == 201 || v_status == '201'){
   var resObj= JSON.parse(v_response);
    outputs.id=resObj.id;
    outputs.key=resObj.key;
    outputs.url=resObj.self;
  } 

})(inputs, outputs);

